import { initializeApp } from 'firebase/app';
import { getAuth } from 'firebase/auth';

const firebaseConfig = {
    apiKey: "AIzaSyCuUg3sFlpBmSCplmjEnlcofwJBWCaXRyc",
    authDomain: "react1-7ecbe.firebaseapp.com",
    projectId: "react1-7ecbe",
    storageBucket: "react1-7ecbe.appspot.com",
    messagingSenderId: "YOUR_MESSAGING_SENDER_ID",
    appId: "YOUR_APP_ID",
};

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const db = getDatabase(app); // Initialize the Realtime Database

export { app, auth, db }; // Export app, auth, and db
